    constructor(props) {
        super(props)
        this.state = {
            account: '0x0',
            name:'rahul'
        }
    }

    render() {
        return (
            <div>
                <Navbar account={this.state.name}/>
                <div className = 'text-center' style={{color:'green',
                fontSize:'120px'}}>
                    <h></h>
                </div>
            </div>
        )
    }
}

export default App;
